css:
@-moz-document domain("passporterapp.com"), domain("passporterapp.es") {
.wrapper, .section, .btn-load-more, .footer, .ambassador-content *, .about-content * {
    background-color: #121212 !important;
    color: white;
}
.about-content .name {
    color: white !important;
}
.navbar, nav, .navbar-expand-lg, .card, .card .right, .image_space, .data_user * {
    color: white !important;
    background-color: #1F1F1F !important;
}
.title {
    color: white !important;
}
.newModalDownload > .container, .newModalDownload i, .newModal i, .modalLogin, .modalLogin i, .base {
    background-color: #121212 !important;
    color: white;
}
.newModalDownload h1 {
    color:white !important;
}
.footer button, .squeleton, .loading, .btn-load-more button {
    background-color: #000000 !important;
}
.banner_download {
    background: rgb(0, 0, 0, 1) !important;
}
.footer button i, .footer button span, .lang select, .banner_download span {
    color: white !important
}
.Logo-Passporter {
    content:url("https://passporterapp.com/assets/img/logos/Passporter_logo_white.png");
}
hr {
    border-color: #1E1E1E !important;
}
/* MODAL */
 .newModal .container {
    background-color: #121212 !important;
}
.newModal i {
    color: white !important;
}
/* BUTTONS */
 .filter, .filtrer {
    background-color: #1E1E1E !important;
}
/* PAGES */
 section container {
    background-color: #1F1F1F !important;
}
.pictures *, .section, .newModalIndependentTrip *, .landing-section {
    background-color: #121212 !important;
}
.sentence, .title, .big_help, .newModalIndependentTrip h1, .title_travels, .home-title {
    color:white !important
}
/* SEARCH RESULT */
 .search-results {
    background-color: #121212 !important;
    color: white;
}
.search_result {
    border-bottom: solid 1px #1E1E1E !important;
}
}
